// src/components/StickyNavbar.js

import React, { useState } from 'react';
import Dropdown from './Dropdown'; // Import your Dropdown component

function StickyNavbar() {
  const [isSticky, setIsSticky] = useState(false);

  const handleScroll = () => {
    if (window.scrollY > 0) {
      setIsSticky(true);
    } else {
      setIsSticky(false);
    }
  };

  window.addEventListener('scroll', handleScroll);

  return (
    <nav
      className={`fixed top-0 left-0 w-full p-4 transition-all duration-300 ${isSticky ? 'bg-gray-200' : 'bg-transparent'} z-50`}
    >
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-xl font-bold">Your Website</h1>
        <Dropdown />
      </div>
    </nav>
  );
}

export default StickyNavbar;
